import React, { Component } from "react";
import index from "../Caduser/index";
/* eslint-disable */

class home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      ListaUsuario: [
        {
          nome: "carlinho",
          email: "c@linhos.com"
        }
      ]
    };
  }

  render() {
    return (
      <div>
        <div>
          <button>Novo Cadastr</button>
        </div>
        <div>
          {this.state.ListaUsuario.map(function(user) {
            <tr>
              <td>{user.nome}</td>
              <td>{user.email}</td>
            </tr>;
          })}
        </div>
      </div>
    );
  }
}

export default home;
